import React from 'react';

export default function AdminNav (props)  {
    return (
        <div>
            <Switch>
          <Route path='/Admin/CabinManage' component={CabinManage} />
          <Route path='/Admin/PostCabin' component={PostCabin} />
        </Switch>
        </div>
    )
}
